import React from 'react';
import { useTranslation } from "react-i18next";
import Layout from './Components/layout';

function Jobs() {
  const { t } = useTranslation();
  return (
    <Layout>
      <div className="home">
        <div className="big-title-Book" > {t("jobs-jobs-title")}
        </div>
      </div>
    </Layout>
  );
};

export default Jobs;
